import React from 'react'
import hand_icon from '../Assets/home.png'
import 'bootstrap/dist/css/bootstrap.css'

const Shop = () => {
  return (
    <div >
    <p> <div className=" col-6 p-4 m-5 text-bg-light">Looking for a brand new home?</div> <img className="col-12 mt-0"src={hand_icon} alt=""/></p>
   
    </div>
  )
}

export default Shop
